let boxes = document.querySelectorAll(".gamebox");

let turn = true;
let winpettern = [
  [0, 1, 2],
  [3, 4, 5],
  [6, 7, 8],
  [0, 3, 6],
  [1, 4, 7],
  [2, 5, 8],
  [0, 4, 8],
  [2, 4, 6],
];
let player1score = 0;
let player2score = 0;
function updatescore() {
  document.getElementById("player1score").innerHTML = `score :${player1score}`;
  document.getElementById("player2score").innerHTML = `score :${player2score}`;
}
const winner = () => {
  drawcounter++;
  for (pattern of winpettern) {
    // console.log(pattern[0],pattern[1],pattern[2]);

    let position0 = boxes[pattern[0]].innerText;
    let position1 = boxes[pattern[1]].innerText;
    let position2 = boxes[pattern[2]].innerText;
    if (position0 != "" && position2 != "" && position2 != "") {
      if (position0 == position1 && position1 == position2) {
        console.log("winner", position0);
        for (let i of pattern) {
          boxes[i].style.background = "lightgreen";
        }

        for (let box of boxes) {
          box.disabled = true;
        }
        if (position0 == "O") player1score++;
        else player2score++;
        updatescore();
        return;
      }
    }
  }
  if (drawcounter == 9) {
    boxes.forEach((box) => {
      box.style.background = "pink";
    });
  }
};
let drawcounter = 0;
document
  .querySelector(".player1_png")
  .classList.toggle("toggleClassForBackground");
boxes.forEach((box) => {
  box.addEventListener("click", () => {
    if (turn) {
      box.innerHTML = "O";
      turn = !turn;
      document
        .querySelector(".player1_png")
        .classList.toggle("toggleClassForBackground");
      document
        .querySelector(".player2_png")
        .classList.toggle("toggleClassForBackground");
    } else {
      box.innerHTML = "X";
      turn = !turn;
      document
        .querySelector(".player1_png")
        .classList.toggle("toggleClassForBackground");
      document
        .querySelector(".player2_png")
        .classList.toggle("toggleClassForBackground");
    }
    box.disabled = true;

    winner();
  });
});

var resetButton = document.getElementById("resetBtn");
function resetfun() {
  turn = true;
  for (let box of boxes) {
    box.disabled = false;
    box.innerHTML = "";
    box.style.background = "white";
    drawcounter = 0;
  }
}

resetButton.addEventListener("click", resetfun);

