let charactername = [
  "Max",
  "Alex",
  "Luna",
  "Max",
  "Bella",
  "Charlie",
  "Daisy",
  "Rocky",
  "Molly",
  "Buddy",
  "Lucy",
  "Cooper",
];

let characterdiv = document.querySelector(".charactersvg");
for(let i=1;i<=12;i++) {
    // let s=`svg/${i}.svg`;
  const sgvbtn = document.createElement("div"); // Create a <span> element
  sgvbtn.innerHTML=`<img src="svg/${i}.svg" alt="error">`

  sgvbtn.className = "characterdiv-item"; // Set the text content of the span to the array element
  characterdiv.appendChild(sgvbtn); // Append the span to the div
};

let player1 = "";
let player2 = "";

let characterdiv_item = document.querySelectorAll(".characterdiv-item");
characterdiv_item.forEach((item) => {
  item.addEventListener("click", () => {
    let i = 0;
    if (player1 == "") {
      i = parseInt(Math.random() * 10);

      player1 = charactername[i];
      document.querySelector(".choicePlayer").innerHTML = "choice player 2";

      document.querySelector(".player1_png").innerHTML = item.innerHTML;
    } else {
      let a = i;
      while (i != a) a = parseInt(Math.random() * 10);

      document.querySelector(".player2_png").innerHTML = item.innerHTML;
      player2 = charactername[a];

      // call main data
      document.getElementById("player2name").innerHTML = player2;
      document.getElementById("player1name").innerHTML = player1;
      document.getElementById("landingpage").style.display = "none";
    }
  });
});
